# get services with no description
Write-Host "Checking for services with no description..." -ForegroundColor Yellow
Get-WmiObject win32_service | ? Description -eq ""

# get all unsigned binaries, it is recommended to change to a directory lower than C:\ to make this run faster
# if a binary isn't signed, it is potentially not legitimate
Write-Host "Checking for binaries with no signature..." -ForegroundColor Yellow
cd ~
Get-ChildItem -File -Recurse | ? Extension -Like .exe | %{$result = Get-AuthenticodeSignature $_.FullName; If($result.Status -ne "valid"){$_.FullName}}

Write-Host "Checking for autoruns with no signature..." -ForegroundColor Yellow
Function Survey-AutoRuns(){
    # don't download all of sysinternals if we don't need it all
    $autoruns = ""
    
    If((Test-Path C:\Windows\System32\autorunsc.exe) -eq $false){
        [IO.File]::WriteAllBytes("C:\Windows\System32\autorunsc.exe", [Convert]::FromBase64String($autoruns))
    }

    $tsv_data = cmd /c "C:\Windows\System32\autorunsc.exe -accepteula -a * -nobanner -ct -h -s *"
    $data = $tsv_data | ConvertFrom-Csv -Delimiter "`t"

    Return $data
}
Survey-AutoRuns | ? Signer -notlike "*Verified*" | ? 'Launch String' -ne "" | Select Time,'Entry Location',Entry,Enabled,Category,Profile,Description,'Image Path',Version,'Launch String'
